import React from "react";


const Songlibrary =({song}) =>{
	
	
	
	return(
	
	<div className="library_songs">
	
	<h1>Music photo</h1>
	<h1>{song.Music_name}</h1>
	<h1>{song.Artist_name}</h1> 
	
	</div>
	
	)
		
		
	
}
export default Songlibrary
